import { Route, Link } from 'react-router-dom'

function App() {
  return (
    <div>
      <Route path="/welcome">
      </Route>
      <Route path="/welcome">
        <Link to="/all-quotes"/>
      </Route>
      <Route path="/welcome">
        <Link to="/add-quote"/>
      </Route>

    </div>
  );
}

export default App;
